    function getNumbers(string memory input)
        internal
        pure
        returns (Number memory result)
    {
        bytes memory stringBytes = bytes(reverseValue(input));
        for (uint256 i = 0; i < stringBytes.length; i++) {
            if (i == 0) {
                result.d = string(abi.encodePacked(stringBytes[i]));
            }
            if (i == 1) {
                result.c = string(abi.encodePacked(stringBytes[i]));
            }
            if (i == 2) {
                result.b = string(abi.encodePacked(stringBytes[i]));
            }
            if (i == 3) {
                result.a = string(abi.encodePacked(stringBytes[i]));
            }
        }
        return result;
    }

    function reverseValue(string memory _base)
        internal
        pure
        returns (string memory)
    {
        bytes memory _baseBytes = bytes(_base);
        assert(_baseBytes.length > 0);

        string memory _tempValue = new string(_baseBytes.length);
        bytes memory _newValue = bytes(_tempValue);

        for (uint256 i = 0; i < _baseBytes.length; i++) {
            _newValue[_baseBytes.length - i - 1] = _baseBytes[i];
        }

        return string(_newValue);
    }

